        "content": "The Nike SB x Air Jordan 4 \"Navy\" is a new installment in the ongoing collaboration between Nike Skateboarding and Jordan Brand. The Nike SB AJ4 looks like a traditional Jordan 4 but has some unique details. Suede is placed around the toe box to make the shoe more skate-friendly. The clean navy and white upper is accented with a gum outsole, and Nike SB branding appears on the heel. <span style=\"color: #fff\">Nike SB - Navy</span>"
