        "content": "The Nike Zoom LeBron NXXT Gen “Black/White” is an easy-to-wear colorway of the alternate version of LeBron James’s twentieth signature shoe with Nike Basketball. Giving fans of LeBron’s signature sneaker line with Nike another option to choose from, the Nike LeBron NXXT Gen in the “Black/White” colorway has a black mesh upper with layered tonal and white Swooshes on the lateral side and a white Swoosh on the black leather overlay on the medial side. A “Nike LBJ” logo is embroidered on the overlay on the laces. An “XX” dubrae appears on the vamp. Release date: June 13, 2023 <span style=\"color: #fff\">Black/White</span>"
