        "content": "The Nike Air Max 1 \"Platinum Tint/Dark Obsidian\" is a versatile colorway of the classic running and lifestyle shoe. Debuted in 1987 as a performance shoe, the Air Max 1 was designed by legendary Nike sneaker designer Tinker Hatfield and is one of the greatest sneakers of all time. The colorway features a white mesh base paired with white felt overlays and a Platinum Tint mudguard wrapping the upper. A Dark Obsidian Swoosh appears on the mid-panel while Platinum Tint “Nike Air” branding is seen on the heel. “Nike Air Max” detailing is printed on the tongue tag. <span style=\"color: #fff\">Dark Obsidian</span>"
