        "handle": "general-purpose-shoe-wmns-tom-sachs-x-nikecraft-065777",
        "description": "The Tom Sachs x NikeCraft “General Purpose Shoe” is a special collaboration between the popular artist and Nike on a shoe that’s “ordinary for extraordinary people.” The “General Purpose Shoe,” or “GPS,” for short, succeeds Sachs and Nike’s previous landmark collaborations on the Mars Yard and Mars Yard 2.0. This June 2022 release by the pair is likened to some of the latter’s most timeless designs, particularly the Killshot and Waffle One models. According to Sachs, he aimed to create a shoe that functioned as “a tool for everyday life.” The upper features a cream-colored mesh construction with a microfiber collar and grey suede overlays. A white painted Swoosh is found on either side. The shoe sits on a three-piece molded cupsole. In terms of comfort, the gum-colored EVA foam midsole provides a soft ride. Release date: June 10, 2022 <span style=\"color: #fff\">Tom Sachs x NikeCraft</span>",
