        "title": "Air Force 1 Low \"Drake NOCTA - Certified Lover Boy\"",
        "handle": "air-force-1-low-drake-nocta-certified-lover-boy-067261",
        "description": "The Drake x Nike Air Force 1 Low “Certified Lover Boy” is a collaboration between the hip-hop star and Nike on the vintage basketball shoe in a colorway inspired by Drake’s “Certified Lover Boy” studio album. This colossal collaboration between Drake and Nike was rumored to be canceled at one point in time, but as it turns out, that was merely speculation as the pair’s Air Force 1 was released at retail in 2022. The shoe features an all-white tumbled leather upper that is reminiscent of the model’s “White on White” colorway. Dual “Nocta” and “Nike Air” branding is embroidered on the heel of the left and right shoe, respectively. Old school “Nike Air Force 1” detailing is found on the tongue tag. Drake’s “Certified Lover Boy” branding replaces the Air Force 1’s signature “Air” insignia on the lateral side of the white rubber midsole. <span style=\"color: #fff\">Drake NOCTA - Certified Lover Boy</span>",
