        "description": "The Nike Dunk Low “Black/White” is a timeless look for the ultra popular low-top shoe that was released in March 2021. The Dunk made an improbable comeback in 2020 to become one of the hottest shoes on the planet after spending several years in the vault. Colorways like the “Black/White” speak to the shoe’s enduring retro style that feels fresher than ever in the present day. Nike places supple black leather overlays on the forefoot, eyelets, collar, and heel. The same black leather detailing can be found on the Swoosh branding on either side and on the heel tab with “Nike” embroidery in white text. The white leather found on the perforated toe and mid-panel and collar forms a clean contrast against the aforementioned black leather panels. A black nylon branding tag with “Nike” insignia is stitched onto the white mesh tongue. Release date: March 10, 2021. <span style=\"color: #fff\">Black / White - Panda</span>",
