        "title": "Dunk Low \"Grey Fog\"",
        "handle": "dunk-low-grey-fog-062940",
        "description": "The Nike Dunk Low “Grey Fog” is a two-tone, white-and-grey colorway of the low-top sneaker that is perfect for styling multiple ways. The “Grey Fog” edition of the Dunk mimics the shoe’s original two-tone style that was popularized by the “Be True to Your School” collection of college basketball-inspired colorways released by Nike in 1985. The upper features white leather on the perforated toe, mid-panel, collar, and heel. Both the overlay panels and Swoosh branding appear in Grey Fog leather. On the back, white “Nike” branding gives the shoe a retro appearance. Classic “Nike” and Swoosh detailing appears on the tongue tag. Release date: September 21, 2021 <span style=\"color: #fff\">Grey Fog</span>",
