        "description": "The Nike Dunk Low “White/Black” is ready for everyday wear with a refined design consisting of two wearable colors: black and white. A January 2021 release, the “White/Black” Dunk Low features a color block reminiscent of the Women’s Air Jordan 1 High “Twist,” a shoe the Dunk shares similar DNA with. Black leather appears on the forefoot, eyelets, collar, and heel. Underlaid white leather can be found on the perforated toe area, collar, and mid-panel. Nike places a classic Swoosh logo on either side of the shoe in black leather. White “Nike” embroidery is stitched onto the heel counter. A white midsole and contrasting black outsole continue the clean and casual look of this Nike Dunk Low. Release date: January 14, 2021. <span style=\"color: #fff\">Panda - Black / White</span>",
