        "content": "The Women’s Nike Dunk Low “Cacao Wow” is a women’s-exclusive colorway of the retro basketball shoe with an old school look. Called the “Cacao Wow” colorway by Nike, this Dunk Low features an off-white white upper with Cacao Wow, or brown, leather overlays and Swoosh branding. Classic “Nike” branding is embroidered on the back of the collar and “Nike” and Swoosh branding are found on the tongue tag. Underfoot, the shoe’s aged-looking midsole gives the silhouette a classic, vintage look. <span style=\"color: #fff\">Cacao Wow</span>"
