        "description": "The Nike Air Max 2 CB ‘94 “2020 Retro” is an original colorway of Charles Barkley’s signature performance basketball shoe from the ‘90s. Quintessentially retro from a design standpoint, the Air Max 2 CB ‘94 returns in its true-to-original form for this Fall 2020 release. The design by Tinker Hatfield, which is inspired by the look of a straitjacket, features a split white leather and black synthetic nubuck design along the eyelets and midsole, respectively. White “Nike” embroidery appears on the midfoot harness that supports the lacing system. Additional details include purple accenting on the nylon tongue, white “Nike Air” embroidery on the heel, and a mini Swoosh on back of the midsole. A visible Air unit in the heel with purple accenting completes the look of this classic hoops silhouette from Nike Basketball. <span style=\"color: #fff\">Black White Purple (2020/2025)</span>",
