        "content": "The Nike Kobe 6 Protro \"Dodgers\" adds a baseball theme to Kobe Bryant's sixth signature shoe. Taking inspiration from the Los Angeles Dodgers' colors, the Kobe 6 has stitching around the top of the tongue that's reminiscent of the stitching on a baseball. The faux snakeskin upper is adorned in Dodger blue to complete the look. <span style=\"color: #fff\">Dodgers</span>"
