        "id": 8058873381060,
        "title": "Little Posite One GS \"Triple Black\"",
        "handle": "little-posite-one-gs-triple-black-120899",
        "description": "The Nike Air Foamposite One GS \"Anthracite\" is the youth sizing of the 2023 re-release of the popular colorway that debuted in 2007. Worn by Anfernee “Penny” Hardaway in the NBA in 1997, the Air Foamposite One was brought back as a lifestyle shoe in the mid-to-late 2000s. The “Anthracite” colorway was released by Nike in 2007 and was one of the retro basketball sneaker’s most sought after designs back in the day. Here, the contemporary version is a one-to-one remake of the original style. The shoe’s molded Foamposite shell is designed in Anthracite, or black. Black synthetic nubuck overlays contrast the look. Hardaway’s signature “1-Cent” branding appears on the heel and tongue. A smoky translucent rubber outsole completes the stealthy design. <span style=\"color: #fff\">Triple Black</span>",
