        "content": "The Nike Dunk Low “Court Purple” is a two-tone, white-and-purple colorway of the retro basketball shoe that was released in 2022. The “Court Purple” Dunk Low features a white leather base with contrasting Court Purple overlays and Swoosh branding. White “Nike” branding is embroidered on the heel and Court Purple “Nike” and Swoosh detailing are printed on the white nylon tongue tag on the white nylon tongue. A two-tone, white midsole and Court Purple rubber outsole completes the look. <span style=\"color: #fff\">Court Purple</span>"
