        "content": "The Nike Air Diamond Turf 49ers (2025) revives Deion Sanders' iconic '93 sneaker, honoring his 49ers tenure. Crisp white leather meets black nubuck, punctuated by vibrant fire red accents on the Swoosh, liner, and outsole. The signature midfoot strap ensures a secure fit and bold style. Built for dual-sport athletes, it offers versatility and comfort. A cushioned midsole provides support, while the durable rubber outsole delivers traction. Tongue and heel branding add flair. This retro release blends nostalgia with fresh design, celebrating Sanders' legendary career and the 49ers' championship legacy. <span style=\"color: #fff\">49ers</span>"
