        "content": "The Yuto Horigome x Nike SB Dunk Low \"Matcha\" is a sleek reflection of the Japanese pro skater's style. This is the second Yuto Dunk and this \"Matcha\" Dunk colorway blends earthy tones on the upper. Yuto's family crest appears on the heel of this Nike SB Dunk that is equipped with Zoom cushioning and ample padding to make it skate friendly. <span style=\"color: #fff\">Yuto Horigome - Matcha</span>"
