        "content": "The Nike SB Dunk Low “White/Gum” is a timeless colorway of the retro skate shoe. Dubbed simply “White/Gum” by Nike SB, this Dunk Low features a versatile white-and-black color block on its design. Specifically, the shoe is constructed with a white leather upper. A black leather Swoosh appears on either side of the shoe and black “Nike” branding is embroidered on the heel. Classic “Nike SB Dunk” detailing is found on the tongue tag. A white midsole and gum rubber outsole complete the look. Release date: March 1, 2023 <span style=\"color: #fff\">White Gum</span>"
